VACCINE PROTEST | There's now concerns about a potential COVID-19 super-spreading event in Newcastle.

Thousands today protested against virus vaccinations in the city.

@laurenkempe

BEST OF THE WEEK

On Friday, Ian Collins reacted to the news that in Scotland, you will have to self-isolate if you've been in contact with a Covid case, regardless of vaccination status.

